import React, { useState } from "react";
import {
  View,
  Text,
  StyleProp,
  ViewStyle,
  TextStyle,
  TouchableOpacity,
  GestureResponderEvent,
} from "react-native";
import { footerstyles } from "../../Styles/FooterStyle";
import Folder from "../../1HelpFullFolder/Folder";
interface FolderModalWindowProps {
  folder: Folder;
  positionX: number;
  widthOfFolder:number;
}

const FolderModalWindow: React.FC<FolderModalWindowProps> = ({
  folder,
  positionX,
  widthOfFolder
}) => {

  return <View style={footerstyles.modalWindowContainerStyle}>
    <View><Text>Add chat</Text></View>
    <View><Text>Edit folder</Text></View>
    <View><Text>On notifications</Text></View>
    <View><Text>Sort folders</Text></View>
    <View><Text>Delete</Text></View>
  </View>;
};

export default FolderModalWindow;
